import React from 'react';

const List = ({ people }) => {
  return (
    <>
      {people.map((data) => {
        const { id, name, age, image } = data;
        return (
          <article key={id} className='person'>
            <img src={image} alt={name} />
            <h4>{name}</h4>
            <p>{age} years</p>
          </article>
        );
      })}
    </>
  );
};

export default List;
